<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>A* Pathfinding</title>

    <link rel="stylesheet" href="styles.css">
    <script>
        var exports = {};
    </script>
    <script src="https://kit.fontawesome.com/c5010863c9.js" crossorigin="anonymous"></script>
    <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.5.1/jquery.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/velocity/2.0.6/velocity.min.js" integrity="sha512-+VS2+Nl1Qit71a/lbncmVsWOZ0BmPDkopw5sXAS2W+OfeceCEd9OGTQWjgVgP5QaMV4ddqOIW9XLW7UVFzkMAw==" crossorigin="anonymous"></script>
    <script src="scripts/faPro.js"></script>

<body class="noselect">
    <header class="flex-space row align-center shadow background-color">
        <h1 id="header-title">A* Pathfinding<br>Algorithm</h1>
        <section class="input-transparent flex-space row">
            <input type="button" id="play"></input>
            <label for="play" class="button h-button" id="play-label">
                        <i class="fas fa-play"></i>
                        play</label>
            <input type="button" id="pause"></input>
            <label for="pause" class="button h-button" id="pause-label">
                        <i class="fas fa-pause"></i>
                        pause</label>

            <input type="button" id="resume"></input>
            <label for="resume" class="button h-button" id="resume-label">
                        <i class="fas fa-play"></i>
                        resume</label>


            <div class="flex-center column align-center">
                <input type="range" min=".5" max="20" value="5" id="speed-range"></input>
                <div class="flex-space max-width row align-center">
                    <i class="fas fa-turtle"></i>
                    <i class="fas fa-rabbit-fast"></i>
                </div>
            </div>

            <input type="button" id="restart"></input>
            <label for="restart" class="button h-button" id="restart-label">
                <i class="fas fa-undo-alt"></i>
                        restart</label>

        </section>
        <section class="input-transparent">
            <input type="button" class="btn-transparent" id="clear"></input>
            <label for="clear" class="button h-button">clear
                    <i class="fas fa-trash-alt"></i>
                </label>
        </section>
    </header>
    <section id="no-edit">
    </section>
    <section id="middle-section" class="flex-space row">
        <aside class="selector background-color" id="left-selector">
            <h2 id="algorithms-text">Algo</h2>
            <legend class="input-transparent flex-center column align-center">
                <input type="checkbox" name="checkbox-algo" id="aStar" checked></input>
                <label for="aStar" class="button v-button button-algo">A*</label>

                <!-- WIP -->

                <!-- <input type="checkbox" name="checkbox-algo" id=" dsijkstra"></input>
